  <style>
    body {

      margin-top: 12px;

      color: #843927;
    }
    .right {
      flex: 1;
      display: flex;
      align-items: center;
      justify-content: center;
      background: none;
    }
    .right img {
      max-width: 100%;
      max-height: 60vh;
      border-radius: 12px;
    }
    @media (max-width: 700px) {
      .container {
        flex-direction: column;
        width: 98vw;
        min-height: unset;
      }
      .right, .left {
        padding: 24px 12px;
      }
      .right img {
        max-height: 30vh;
      }
    }
